local szIP2BIN = [[]];
local ip2bin;

if(type(Application) == "table")then
    ip2bin = Library.Load(szIP2BIN, true);
    if(ip2bin)then
        ip2bin.init();
        ip2bin:SetReturnType_(MEMEX_RETURNTYPE_STRING);
    else
        error("ip-bin could not be initialized.", 2);
    end
end

return {
    info = {
        name            = "ipbin.lh";
        description     = "An LH module for converting an IP address to country code.";
        author          = "Imagine Programming <Bas Groothedde>";
        contact         = "http://www.imagine-programming.com/contact.html";
        website         = "http://www.imagine-programming.com/";
    };
    
    constants = {
        ipbin = {
            --[[ country
                @address:       An IPv4 address to determine the country for
                
                returns:        A 2-char country code, or ZZ for reserved addresses.
            ]]
            country = function(address)
                if(type(address) ~= "string")then
                    error("country: expected a string for argument 1, got '"..type(address).."'", 2);
                end
                
                return ip2bin.country(address);
            end;
        };
    };
    
}